var Savitr = function(game_board, options) {
  // game_board: <div> where game is drawn
  // options: see settings below, including default values
  var settings = {
    columns: 4,
    rows:    3,
    shuffle: true
  };

  $.extend(settings,options);  // options override the default settings

  // Universal constants
  var numbers  = ['one',   'two',      'three'];
  var colors   = ['red',   'green',    'purple'];
  var shadings = ['empty', 'striped',  'solid'];
  var shapes   = ['oval',  'squiggle', 'diamond'];

  var deck = new_deck(settings['shuffle']);

  var rows = settings['rows'];
  var columns = settings['columns']

  if (rows * columns > deck.length) {
    throw 'rows: ' + rows + ',columns: ' + columns + ' too big for deck size: ' + deck.length;
  }

  // Game state
  var selected = []; // each value is card id (index into `deck`)

  game_board.html(draw_board(rows,columns));

  game_board.addClass('savitr'); // tag the game board, for styling and identification purposes

  function start() {
    selected = [];  // clear selected so the reset button can call this method

    deal_cards();

    // make cards clickable
    $('.card', game_board).click(card_click);

    update_status('Savitr');
  }

  function draw_board(rows,columns) {
    var board = $('<div/>').addClass('main');


    var table = $('<table/>').addClass('board');

    table.append($('<tr class="header">'+
                      '<th class="sets_left" align="left"></th>' +
                      '<th class="message" align="center" colspan="'+(columns-2)+'"></th>' +
                      '<th class="controls" align="right"><button class="control reset">reset</button></th>' +
                    '</tr>'));
    $('.controls .reset',table).click(start);

    for (var r=0; r < rows; r++) {
      var row = $('<tr/>');
      for (var c=0; c < columns; c++) {
        row.append($('<td/>').addClass('board-' + ((r*columns)+c+1)));
      }
      table.append(row);
    }

    board.append(table);

    return board;
  }

  function new_deck(shuffle) {
    // shuffle can be true/false or a string to set the random seed; true for arbitrary seed
    var deck = [];

    numbers.forEach(function(number) {
      colors.forEach(function(color) {
        shadings.forEach(function(shading) {
          shapes.forEach(function(shape) {
            var card = {number: number, color: color, shading: shading, shape:shape};
            deck.push(card);
          })
        })
      })
    });

    if (shuffle) {
      // checked the code and null seed is same as Math.seedrandom()
      var rng = new Math.seedrandom(typeof shuffle === 'string' ? shuffle : null);
      shuffle_array(deck, rng);
    }

    return deck;
  }

  function update_status(messages) {
    // could pass in a "string" or ["array","of","strings"]
    messages = [].concat(messages);

    // How many sets are there laid out?
    var sets_left = sets_in(cards_left());

    $('.sets_left',game_board).html(
      (sets_left == 0 ? 'No sets' : sets_left.length + ' set' + (sets_left.length>1 ? 's' : '')) + ' left');
    $('.message',game_board).html(messages.join(' '));
  }

  function cards_left() {
    var cards_left = [];
    $.each($('.card',game_board), function(index,c) {
      var card_number=$(c).attr('id').split('-')[1];
      cards_left.push(deck[card_number]);
    });

    return cards_left;
  }

  function deal_cards() {
    for (var i=0; i < settings['rows']*settings['columns'] ; i++) {
      var card_index = i;  // deck is shuffled, assuming, so the i'th item in the deck is the i'th card placed
      var card = deck[card_index];
      // _Joy of Set_ file naming scheme (p. ???); Blake chopped these up, thanks Blake!
      var number_code = {one: '1', two: '2', three: '3'};
      var color_code = {red: 'R', green: 'G', purple: 'P'};
      var shading_code = {empty: 'O', striped: 'S', solid: 'F'};
      var shape_code = {oval: 'O', squiggle: 'S', diamond: 'D'};
      var file_name = number_code[card.number] + color_code[card.color] + shading_code[card.shading] + shape_code[card.shape];
      var board_cell = $('.board-'+(i+1), game_board);
      var img = $('<img id="card-'+card_index+'" src="data:image/png;base64,'+images[file_name]+'"/>').addClass('card');
          //$('<img id="card-'+card_index+'" src="images/'+file_name+'.png"/>').addClass('card');
      board_cell.html(img);
    }
  }

  function card_click() {
    var card_number=$(this).attr('id').split('-')[1];

    var already_selected = (selected.indexOf(card_number) != -1);

    // if cell not yet selected
    //   - 3 already selected?  ignore
    //   - select it: test for set & clear
    // if cell already selected
    //   - unselect it

    if (!already_selected) {
      // not already selected, add it if there's not already 3 selected
      if (selected.length < 3) {
        selected.push(card_number);
        $(this).parent('td').toggleClass('selected');
      }

      if (selected.length == 3) {
        var selected_cards = [];
        selected.forEach(function(c) {
          selected_cards.push(deck[c]);
        });
        if (is_set(selected_cards)) {
          var messages = ['SET!'];

          // remove the cards and unselect the board spots
          selected = [];
          $('.selected .card', game_board).remove();
          $('.selected', game_board).toggleClass('selected');

          if ($('.card', game_board).length == 0) {
            messages.push('CLEARED!!!');
          }

          if (sets_in(cards_left()).length == 0) {
            messages.push('NO SETS LEFT');
          }

          update_status(messages);
          console.log(messages, selected_cards);
        } else {
          // TODO: maybe also update status so it's game board visible?

          // three cards selected, but not a set, let's log why:
          console.log(selected_cards,
            'not a set because',vector_mod3(vector_sum(selected_cards)));
        }
      }
    } else {
      // already has been selected, unselect it
      selected.splice(selected.indexOf(card_number), 1);

      // update UI
      $(this).parent('td').toggleClass('selected');
    }
  }

  function is_set(three_cards) {
    var mod3_vector = vector_mod3(vector_sum(three_cards));
    return (mod3_vector['number']  == 0) &&
           (mod3_vector['color']   == 0) &&
           (mod3_vector['shading'] == 0) &&
           (mod3_vector['shape']   == 0);
  }

  function vector_mod3(vector) {
    return {
      number: vector['number'] % 3,
      color: vector['color'] % 3,
      shading: vector['shading'] % 3,
      shape: vector['shape'] % 3
    };
  }

  function vector_sum(three_cards) {
    if (three_cards.length != 3) {
      throw 'must be exactly three cards: ' + three_cards;
    }

    // test it for set-ness

    // map card into 4-dimensional point space
    var sum = {
      number: 0,
      color: 0,
      shading: 0,
      shape: 0
    };

    three_cards.forEach(function(card) {
      var current_point = {
        number: numbers.indexOf(card['number']),
        color: colors.indexOf(card['color']),
        shading: shadings.indexOf(card['shading']),
        shape: shapes.indexOf(card['shape'])
      };
      sum = {
        number: sum['number'] + current_point['number'],
        color: sum['color'] + current_point['color'],
        shading: sum['shading'] + current_point['shading'],
        shape: sum['shape'] + current_point['shape']
      };
    });

    return sum;
  }

  function sets_in(cards) {
    // At first I thought a limiter was needed here, but turns out that 81 cards
    // is 85,320 evaluations (and 1,080 sets) and actually unnoticably performant.
    var sets = [];
    var counter = 0;
    for (var i=0; i<cards.length;i++) {
      for (var j=i+1; j<cards.length;j++) {
        for (var k=j+1;k<cards.length;k++) {
          counter++;
          var set_possibility = [cards[i],cards[j],cards[k]];
          if (is_set(set_possibility)) {
            sets.push(set_possibility);
          }
        }
      }
    }

    console.log(cards.length, ' cards ',
                counter, ' possible sets evaluated.  Found ',
                sets.length, 'sets:', sets);

    return sets;
  }

  function shuffle_array(array, rng) {
    if (rng == null) {
      rng = Math.random;
    }
    // Randomize array element order in-place.
    // Using Durstenfeld shuffle algorithm.
    //   * borrowed from https://stackoverflow.com/questions/2450954/how-to-randomize-shuffle-a-javascript-array
    for (var i = array.length - 1; i > 0; i--) {
      var j = Math.floor(rng() * (i + 1));
      var temp = array[i];
      array[i] = array[j];
      array[j] = temp;
    }
  }

  // images below generated using `ruby base64_images.rb | pbcopy`
  //   TODO: optimize the images.  shouldn't need 81 images when there's only 3 shapes
  var images = {};
  images['3RFO'] = '';
  images['1GSD'] = '';
  images['1GSS'] = '';
  images['1GFS'] = '';
  images['1GFD'] = '';
  images['3RSO'] = '';
  images['3PSO'] = '';
  images['2GOS'] = '';
  images['2GOD'] = '';
  images['3PFO'] = '';
  images['1PSO'] = '';
  images['2ROO'] = '';
  images['1PFO'] = '';
  images['3GSS'] = '';
  images['3GSD'] = '';
  images['1RFO'] = '';
  images['2POO'] = '';
  images['1RSO'] = '';
  images['3GFD'] = '';
  images['3GFS'] = '';
  images['2RFS'] = '';
  images['2RFD'] = '';
  images['1POD'] = '';
  images['1POS'] = '';
  images['2RSD'] = '';
  images['2RSS'] = '';
  images['3GOO'] = '';
  images['2PSS'] = '';
  images['2PSD'] = '';
  images['1ROS'] = '';
  images['1ROD'] = '';
  images['2PFD'] = '';
  images['2PFS'] = '';
  images['1GOO'] = '';
  images['3ROD'] = '';
  images['3ROS'] = '';
  images['3POS'] = '';
  images['3POD'] = '';
  images['2GSO'] = '';
  images['2GFO'] = '';
  images['2PFO'] = '';
  images['1ROO'] = '';
  images['2PSO'] = '';
  images['3GOS'] = '';
  images['3GOD'] = '';
  images['2RSO'] = '';
  images['1POO'] = '';
  images['2RFO'] = '';
  images['2GFD'] = '';
  images['2GFS'] = '';
  images['2GSS'] = '';
  images['2GSD'] = '';
  images['3POO'] = '';
  images['3ROO'] = '';
  images['1GOD'] = '';
  images['1GOS'] = '';
  images['3PFD'] = '';
  images['3PFS'] = '';
  images['2GOO'] = '';
  images['3PSS'] = '';
  images['3PSD'] = '';
  images['3RSD'] = '';
  images['3RSS'] = '';
  images['1GFO'] = '';
  images['1GSO'] = '';
  images['3RFS'] = '';
  images['3RFD'] = '';
  images['3GFO'] = '';
  images['1RSS'] = '';
  images['1RSD'] = '';
  images['2POS'] = '';
  images['2POD'] = '';
  images['1RFD'] = '';
  images['1RFS'] = '';
  images['3GSO'] = '';
  images['1PFS'] = '';
  images['1PFD'] = '';
  images['2ROD'] = '';
  images['2ROS'] = '';
  images['1PSD'] = '';
  images['1PSS'] = '';

  return {start: start};
};


